import React from "react";
import ReactDOM from "react-dom";
import sData from "./components/demo1";

ReactDOM.render(
    <>
        {sData.map((val, index) => <div><h1 key = {val.id}>{val.id}</h1></div>)}
        
    </>,
    document.getElementById('root')
);
